import React from 'react';
import { BrowserRouter as Router } from 'react-router-dom';
import Navbar from './components/Navbar';
import Slider from './components/Slider';
import Testimonial from './components/Testimonial';
import { SliderData } from './components/SliderData';
import { TestimonialData } from './components/TestimonialData';
import './App.css';
import JobSection from './components/JobSection';
import { JobSectionData } from './components/JobSectionData';
import { homeObjThree } from './components/JobSectionData';
import Footer from './components/Footer';


function App() {
  return (
    <>
      <Router>
        <Navbar />
        <Slider slides={SliderData} />
        <Testimonial data={TestimonialData} />
        <JobSection {...JobSectionData} />
        <JobSection {...homeObjThree } />
        <Footer/>
      </Router>

    </>
  );
}

export default App;
